import React from "react";
import PriorityBadge from "../UI/PriorityBadge";
import ThreeDot from "../UI/ThreeDot";

const TodoItem = () => {
  return (
    <div className="todo__item">
      <div className="todo__item-id">1</div>
      <div className="todo__item-title">Talk To Amir</div>
      <div className="todo__item-">Amir is my cousin. I talk him for money</div>
      <div className="todo__item-">
        <PriorityBadge label="high" />
      </div>
      <div className="todo__item-">
        <input type="checkbox" />
      </div>
      <div className="todo__item-">
        <ThreeDot />
      </div>
    </div>
  );
};

export default TodoItem;
